import React from "react";
import classes from "./dropDownMenu.module.scss";

const DropDownMenu = () => {
  return (
    <div className={classes.dropDown}>
      <h4>Hello how are you</h4>
      <ul>
        <li>In fine okay thank you how are you</li>
      </ul>
    </div>
  );
};

export default DropDownMenu;
